  padding-left: 40px;
  max-height: 400px;
  height: 100%;
  padding-left: 200px;
  padding-right: 200px;
  line-height: 150%;
  font-weight: 700;
  color: white;
  background-color: black;
  font-size: 23px;
  text-align: left;
  padding-top: 60px;
  padding-bottom: 100px;
